('announcement', 'Announcement', 'node_content', 'announcement', 'Manage timely company specific announcements like special exhibition for employees.', '', 1, 'Announcement Title', 0, 1, 1, 0, 'announcement'),
('article', 'Article', 'node_content', 'node', 'Use <em>articles</em> for time-sensitive content like news, press releases or blog posts.', '', 1, 'Title', 1, 1, 0, 0, 'article'),
('cluster_of_links', 'Cluster Of Links', 'node_content', 'cluster_of_link', 'cluster of links', '', 1, 'Title', 0, 1, 1, 0, 'cluster_of_links'),
('company_news', 'Company News', 'node_content', 'company_news', 'Managing company specific news which are in the interest of employees.\r\nNews can belong to one of he departments such as HR, finance etc.', '', 1, 'News Title', 0, 1, 1, 0, 'company_news'),
('cxo_messages', 'CXO messages', 'node_content', 'cxo_s_messages', 'CXO messages', '', 1, 'Title', 0, 0, 1, 0, 'cxo_messages'),
('event_calendar', 'Event Calendar', 'node_content', 'event', 'A content type to create events for calendar.', '', 1, 'Event Title', 0, 0, 1, 0, 'event_calendar'),
('filedepot_folder', 'Filedepot Folder', 'filedepot', 'filedepot', 'Folder for storing documents', '', 1, 'Folder Name', 0, 1, 0, 0, 'filedepot_folder'),
('holiday_calendar', 'Holiday Calendar', 'node_content', 'holiday_calendar', 'Provides widget for holiday calendar in home page. Admin can mange holidays and add a new holiday calendar year.', '', 1, 'Holiday calendar year', 0, 0, 1, 0, 'holiday_calendar'),
('page', 'Basic page', 'node_content', 'node', 'Use <em>basic pages</em> for your static content, such as an ''About us'' page.', '', 1, 'Title', 1, 1, 0, 0, 'page'),
('photo_gallery', 'photo gallery', 'node_content', 'photo_gallery', 'photo gallery', '', 1, 'Title', 0, 1, 1, 0, 'photo_gallery'),
('poll', 'Poll', 'poll', 'poll', 'A <em>poll</em> is a question with a set of possible responses. A <em>poll</em>, once created, automatically provides a simple running count of the number of votes received for each response.', '', 1, 'Question', 0, 1, 1, 0, 'poll'),
('quote', 'Quote', 'node_content', 'quote_of_the_day', 'This allows creation and management of a quote in rich text format.', '', 1, 'Quote Title', 0, 1, 1, 0, 'quote');
