(1, 'node', ' lord of the rings  not all those who wander are lost jrrtolkien  ', 0),
(2, 'node', ' persistent s technology boost for kumbh mela  persistent s technology boost for kumbh mela simhastha kumbh mela one of the largest humancongregations concluded recently on 25th sept 2015 held every 12 years at nashiktrimbakeshwar on the banks of river godavari theevent attracts millions of devotees from across india and even rest of theworld an event of this scale poses an enormous challenge for theadministration and police authorities this year at kumbh mela persistent workedclosely with nashik rural police to help them digitize their trimbakeshwarcontrol room we worked jointly with nashik rural police and provided a cloudbased control room enabler customized out of accelerite s emergency responsesolution this was also an example of exemplary team work within persistent with the government bu leading the engagement base managing theonsitedeployment and accelerite providing the product solution and overalltechnology ownership   our solution helped the police authorities tovisualize their entire field deployment along with key landmarks primaryroutes and evacuation routes on an easytouse dashboard the solution enabledthe authorities to dynamically view various map layers based on the situationat hand thus helping them to swiftly respond to situations and manage theevent more efficiently lending support to the social media presence ofkumbhmela persistent s emee team took complete ownership of the social mediastrategy execution and analytics for the official kumbhmela handle includingcontent creation the challenge was to maintain public interest in anoncelebrity topic such as the development works done by the cityadministration while providing critical updates and being the eyes and ears ofthe administration it was also important to appear nonpartisan nonpoliticaland steer clear of controversial topics the emee team deployed its socialradar which was previously used for chennai express smj and is now beingeffectively used by the pune smart city team persistent is extremely proud to contribute tothe success of kumbh mela ', 0),
(3, 'node', ' beatles  life is what happens to you while you are busy doing other things john lennon  ', 0),
(4, 'node', ' celebrating 10 years of goa centre  october 5 2015   heartiest congratulations to every member of our goa team as we celebrate 10 years of our presence in goa today as some of you may be aware we acquired controlnet in goa in 2005 which marked the beginning of our presence in goa controlnet was established in 1998 by vinod bharadwaj the father of the ethernet switch and a silicon valley based serial entrepreneur controlnet was focused on product development in embedded systems semiconductor and asic design software   on october 5 2005 when persistent acquired controlnet the team was just about 100 over the last 10 years i am really proud of the achievements of the goa team today our goa team is more than 500 and is an integral part of persistent they have lived up to the value systems that define persistent and have set a benchmark for exemplary standards of customer success   the goa centre has established itself as a technology powerhouse in the company and is wellknown for crafting amazing technology solutions on the modern fullstack with agile techniques as a demonstration of their craft the goa teams have been winners in our annual semicolons title for the last two years running a hattrick would be nice but i am sure all the other teams would be pushing harder this year    i am very impressed by the enthusiasm and the social conscience of our goa teams they are active participants in the activities of persistent foundation and have contributed to local social and community activities their efforts have helped us be better invested in the local community in goa   i take this opportunity to congratulate the entire team on achieving this milestone and wish many more successes to come a special mention and appreciation to all those who have been with the team right from inception your support has been most valuable to shaping the success path of the centre   i wish all the best to the entire team for an exciting journey ahead   anand   ', 0),
(5, 'node', ' announcing siddhesh bhobe as the center head for pune dear friends please join me to welcome siddhesh bhobe as the center head for pune location as part of his additional role in his new role he will focus on the following areas work with different delivery head s to help manage the pune delivery operations build technical capabilities to support business growth build persistent s brand image through promotional activities siddhesh joined persistent in feb 1998 after his mtech in computer science and engg from iit bombay during his stint here he worked for customers like microsoft and ibm and kickstarted some of our large enterprise accounts including bridgestone wells fargo coca cola and schlumberger he created and led the microsoft technology practice for many years and for the last 5 years he has aggressively driven our gamification product portfolio under the emee brand during which he did some very exciting work with shah rukh khan for chennai express and aamir khan for satyamev jayate it s this excitement and breadth of experiences he gets with persistent that keeps him going as center head siddhesh says his aim is to endeavor to provide that shared sense of excitement and passion to every pslite siddhesh married his childhood sweetheart madhavi in 98 after an 8 year courtship and they live in aundh with their beautiful daughter sanam 14 and a very spoilt cat catrina 8 originally from goa where his parents and extended family lives siddhesh is very passionate about his 5 cs cinema cuisine cars camera and cats not necessarily in that order siddhesh is an avid blogger  http siddheshk3gblogspotcom  and is very active on twitter siddheshb wish him good luck in his stint with persistent systems  ', 0),
